import firstimg from "./SliderIMGs/firstimg.webp"
import secondimg from "./SliderIMGs/secondimg.png"
import thirdimg from "./SliderIMGs/thirdimg.png"

export default [
    {
        title: "First Slide",
        description: "First slide of carousel",
        url: firstimg,
    },
    {
        title: "Second Slide",
        description: "Second slide of carousel",
        url: secondimg,
    },
    {
        title: "Third Slide",
        description: "Third slide of carousel",
        url: thirdimg,
    },
];
